预处理文件的内容与原始源代码不同，它是已经展开并处理过的代码，常见的变化包括： 宏替换 ：所有的宏定义和使用都被展开，宏被替换为具体的代码。 原始代码： #define PI 3.14
float area = PI * r * r; 预处理后的代码： float area = 3.14 * r * r; 头文件展开 ：所有 #include 指令包含的头文件会被替换为头文件中的具体内容。 原始代码： #include <stdio.h> 预处理后的代码： // 展开 stdio.h 的内容
extern FILE *stdin;
extern FILE *stdout;
extern FILE *stderr; 条件编译 ：根据条件的不同，选择性地包含或排除代码。 原始代码： #ifdef DEBUG
printf("Debug mode\n");
#endif 如果没有定义 DEBUG，预处理后的代码将不包含 printf 语句： // 代码被预处理器移除了，因为 DEBUG 没有定义 去除注释 ：所有的注释都会被删除。 原始代码： // 这是一个单行注释
/* 这是一个多行注释 */
int a = 10; 预处理后的代码： int a = 10;

