假设我们有一个函数： PUB_FUNC void my_function() { // 函数实现
} 如果在构建 TCC 时定义了 LIBTCC_AS_DLL，这段代码会被展开为： __declspec(dllexport) void my_function() { // 函数实现
} 这样，my_function 函数就会被导出到 DLL 中，外部程序可以调用它。 如果没有定义 LIBTCC_AS_DLL，则 PUB_FUNC 会被定义为空，最终代码变为： void my_function() { // 函数实现
} 在这种情况下，my_function 只是一个普通的函数，不会被导出到 DLL 中。

