/* dynarrays */ ST_FUNC void dynarray_add(void *ptab, int *nb_ptr, void *data)
{ int nb, nb_alloc; void **pp; nb = *nb_ptr; pp = *(void ***)ptab; /* every power of two we double array size */ if ((nb & (nb - 1)) == 0) { if (!nb) nb_alloc = 1; else nb_alloc = nb * 2; pp = tcc_realloc(pp, nb_alloc * sizeof(void *)); *(void***)ptab = pp; } pp[nb++] = data; *nb_ptr = nb;
} ST_FUNC void dynarray_reset(void *pp, int *n)
{ void **p; for (p = *(void***)pp; *n; ++p, --*n) if (*p) tcc_free(*p); tcc_free(*(void**)pp); *(void**)pp = NULL;
} static void tcc_split_path(TCCState *s, void *p_ary, int *p_nb_ary, const char *in)
{ const char *p; do { int c; CString str; cstr_new(&str); for (p = in; c = *p, c != '\0' && c != PATHSEP[0]; ++p) { if (c == '{' && p[1] && p[2] == '}') { c = p[1], p += 2; if (c == 'B') cstr_cat(&str, s->tcc_lib_path, -1); if (c == 'R') cstr_cat(&str, CONFIG_SYSROOT, -1); if (c == 'f' && file) { /* substitute current file's dir */ const char *f = file->true_filename; const char *b = tcc_basename(f); if (b > f) cstr_cat(&str, f, b - f - 1); else cstr_cat(&str, ".", 1); } } else { cstr_ccat(&str, c); } } if (str.size) { cstr_ccat(&str, '\0'); dynarray_add(p_ary, p_nb_ary, tcc_strdup(str.data)); } cstr_free(&str); in = p+1; } while (*p);
}

