char name[1] 在这个结构体的定义中只是一个占位符。它的作用是让 name 作为数组的一部分进行引用，但并不真正限制其大小。通常，开发者会在分配这个结构体的内存时，额外分配足够的空间来存放整个字符串。 在内存分配的时候，实际的内存空间远大于 name[1] 表示的 1 个字符，结构体中的 name 只是在编译时占了 1 个字节的空间，但可以在运行时分配更多内存。 例子： #include <stdio.h>
#include <stdlib.h>
#include <string.h> struct filespec { char type; char name[1]; // 占位符
}; int main() { const char *filename = "very_long_filename.txt"; // 计算实际需要的结构体大小，并分配足够的内存 size_t size = sizeof(struct filespec) + strlen(filename); struct filespec *file = (struct filespec *)malloc(size); // 设置 type file->type = 'f'; // 复制字符串到 name 处 strcpy(file->name, filename); printf("Type: %c, Name: %s\n", file->type, file->name); free(file); return 0;
} 在这个例子中： 虽然 name[1] 声明只有 1 字节，但我们通过 malloc 实际分配了足够的内存来存储整个字符串。 sizeof(struct filespec) 只包含 name[1] 的 1 字节加上 type 的 1 字节，但通过 strlen(filename) 计算实际需要的内存来存放整个字符串。 使用 strcpy 将长字符串复制到 name 的位置，name 处实际上可以容纳更长的字符串，因为它背后的内存已经扩展。

