在 C99 及后来的标准中，标准的做法是使用 柔性数组成员 ，这是一种更加规范的方法来表示结构体中的可变长度数组。与 char name[1] 不同，柔性数组成员的写法是 char name[]，数组的大小不在定义时指定，而是由分配的内存决定。 例子（柔性数组成员）： struct filespec { char type; char name[]; // 柔性数组成员
}; 在使用柔性数组成员时，通常也是通过动态内存分配来确保有足够的空间。 #include <stdio.h>
#include <stdlib.h>
#include <string.h> struct filespec { char type; char name[]; // 柔性数组成员
}; int main() { const char *filename = "very_long_filename.txt"; // 计算需要的内存，分配结构体大小加上字符串长度 size_t size = sizeof(struct filespec) + strlen(filename) + 1; // +1 是为了终止符 '\0' struct filespec *file = (struct filespec *)malloc(size); file->type = 'f'; strcpy(file->name, filename); printf("Type: %c, Name: %s\n", file->type, file->name); free(file); return 0;
} 与前面 name[1] 的实现相比，柔性数组成员 name[] 是 C 标准中的做法，编译器也会对此进行一些额外的支持。两者在运行时的效果几乎一样，但后者是更标准、推荐的做法。

