{ struct scope f = { 0 }; cur_scope = root_scope = &f; // 当前作用域和跟作用域 nocode_wanted = 0; cur_text_section->sh_flags |= SHF_EXECINSTR; ind = cur_text_section->data_offset; if (sym->a.aligned) { size_t newoff = section_add(cur_text_section, 0, 1 << (sym->a.aligned - 1)); gen_fill_nops(newoff - ind); } funcname = get_tok_str(sym->v, NULL); func_ind = ind; func_vt = sym->type.ref->type; func_var = sym->type.ref->f.func_type == FUNC_ELLIPSIS; /* NOTE: we patch the symbol size later */ put_extern_sym(sym, cur_text_section, ind, 0); if (sym->type.ref->f.func_ctor) add_array (tcc_state, ".init_array", sym->c); if (sym->type.ref->f.func_dtor) add_array (tcc_state, ".fini_array", sym->c); /* put debug symbol */ tcc_debug_funcstart(tcc_state, sym); /* push a dummy symbol to enable local sym storage */ sym_push2(&local_stack, SYM_FIELD, 0, 0); local_scope = 1; /* for function parameters */ gfunc_prolog(sym); tcc_debug_prolog_epilog(tcc_state, 0); local_scope = 0; rsym = 0; clear_temp_local_var_list(); func_vla_arg(sym); block(0); gsym(rsym); nocode_wanted = 0; /* reset local stack */ pop_local_syms(NULL, 0); tcc_debug_prolog_epilog(tcc_state, 1); gfunc_epilog(); /* end of function */ tcc_debug_funcend(tcc_state, ind - func_ind); /* patch symbol size */ elfsym(sym)->st_size = ind - func_ind; cur_text_section->data_offset = ind; local_scope = 0; label_pop(&global_label_stack, NULL, 0); sym_pop(&all_cleanups, NULL, 0); /* It's better to crash than to generate wrong code */ cur_text_section = NULL; funcname = ""; /* for safety */ func_vt.t = VT_VOID; /* for safety */ func_var = 0; /* for safety */ ind = 0; /* for safety */ func_ind = -1; nocode_wanted = DATA_ONLY_WANTED; check_vstack(); /* do this after funcend debug info */ next();
} gen_function 是 TinyCC 中负责生成一个函数代码的核心函数。它的作用是完成函数代码的生成，包括设置作用域、处理函数的入口和出口、生成必要的调试信息、符号管理等。下面我会详细分解这个函数的每个步骤，帮助你理解它的内部逻辑。

